import React, { Component } from 'react';
import SignIn from './SignIn';
import SignUp from './SignUp'

class LogInElt extends Component {
    constructor(props) {
        super(props)
        this.state = {
            typeOf: "SignIn",
        }
    }
    render() {
        if (this.props.typeOf === "SignIn") {
            return (
                <SignIn />
            )
        } else {
            return (
                <SignUp />
            );
        }

    }
}

export default LogInElt;
